import React from 'react';
import Logo from '../Images/MIS SERVICES REQUEST (1).png';
import Logo2 from '../Images/logocsucc.png';
import Logo3 from '../Images/carsucc.png';

const Header = () => {
	return (
		<div className='header'>
			<img src={Logo2} alt='logo' width='500' height='100' />
			<div className='logo'>
				<h1 className='logocolor'>
					<img src={Logo} alt='logo' />
				</h1>
				<h2 className='logor2'></h2>
			</div>
		</div>
	);
};
export default Header;
